import React from "react";
import logo from "../photo.jpeg";
const About = () => {
  return (
    <>
      <section class="about-box" id="about">
        <div className="header-text">
          <h1 className="h1"> About ME </h1>
        </div>
        <div className="about">
          <div className="img-box-left">
            <img src={logo} alt="logo" />
          </div>

          <div className="text-box-right">
            <p>
              Myself Tanishq Gupta from Lucknow College of Professional Studies
              . I am Flexible, Feliable and Enthusiastic, Self Motivated
              ,Responsible and Hard Working Person. Eager to learn new thing .
              to Start the Career as an Fresher
            </p>
          </div>
        </div>
      </section>
    </>
  );
};

export default About;
